import React from 'react';
import ReactDOM from 'react-dom/client';

import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <div className="imp-message">
        It is only for the mobile
    </div>

    <App />
    <script src="https://demo-designprojects.com/html/sigma-bank/js/jquery.js"></script>
    <script src="https://demo-designprojects.com/html/sigma-bank/js/chart.min.js"></script>

  </React.StrictMode>
);
function appendScripts(scriptName) {
  const script = document.createElement("script");
  script.src = scriptName;
  document.body.appendChild(script);
}
window.addEventListener("load", function() {
  // appendScripts("../js/chart.min.js")
  appendScripts("https://demo-designprojects.com/html/sigma-bank/js/bootstrap.min.js")
  appendScripts("https://demo-designprojects.com/html/sigma-bank/js/particles.js")
  appendScripts("https://demo-designprojects.com/html/sigma-bank/js/particles.min.js")
  appendScripts("https://demo-designprojects.com/html/sigma-bank/js/slick.js")
  appendScripts("https://demo-designprojects.com/html/sigma-bank/js/app.js")
});
// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
